import React from 'react';
import Slider from 'react-slick';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import photo1 from '../../photos/JBL4325/DSC_0007.JPG';
import cl from './Portfolio.module.css';

const Portfolio = () => {
    const settings = {
        dots: true,
        // infinite: true,
        // speed: 500,
        slidesToShow: 2,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 1500,
        arrows: false,
    };
    return (
        <Slider {...settings} style={{marginRight:25}}>
        <div className={cl.photo}>
            <img src={photo1} alt='meow' />
        </div>
        <div>
            <img src={photo1} alt='meow' />
        </div>
        <div>
            <img src={photo1} alt='meow' />
        </div>
    </Slider>
    );
};

export default Portfolio;
